static int
 fd_mask_flags(int fd, int and_mask, int xor_mask)
 {
	int ret;

 	assert(fd >= 0);

	ret = fcntl(fd, F_GETFD, 0);
	if (ret < 0)
		return ret;

	return fcntl(fd, F_SETFD, (ret & and_mask) ^ xor_mask);
 }

 #endif /* !WIN32 */

